import React from 'react';

const Listing = (props) => {
  const {
    available, 
    city, 
    condition, 
    list_id, 
    list_name, 
    price, 
    seller,
    contact_info
  } = props;
  
  return (
    <section
      style={{
        width: '600px',
        padding: '20px',
        display: 'flex',
        flexWrap: 'wrap'
      }}
    >
      <span>1</span>
      <span><b>Category:</b> {`${list}`}</span>
      <span><b>Name:</b> {`${seller}`}</span>
      <span><b>Condition:</b> {`${condition}`}</span>
      <span><b>Price:</b> 	&pound;{`${price}`}</span>
      <span><b>City:</b> {`${city}`}</span>
      <span><b>Available:</b> {available ? (<>Yes</>) : (<>No</>)}</span>
      <span><b>Seller Contact:</b> {`${contact_info}`}</span>
    </section>
  )
};

export default Listing;
